import React from 'react';
import Icon from '../Icon';
import './Sidebar.css';

const Sidebar = () => {
  return (
    <aside className="sidebar">
      <div className="sidebar-menu">
        <a href="#" className="menu-item active">
          <Icon name="person-ribbon" className="menu-icon" />
          <span>My Referral Network</span>
        </a>
        <a href="#" className="menu-item">
          <Icon name="layer-diagonal-person" className="menu-icon" />
          <span>Waterfall Referrals</span>
        </a>
        <a href="#" className="menu-item">
          <Icon name="person-search" className="menu-icon" />
          <span>Members Directory</span>
        </a>
      </div>
    </aside>
  );
};

export default Sidebar;
